skill[2834] = {skillName = "Rage of Shadow", desc = "Passive Skill: Aspen's normal attack deals [100% Attack] damage against 3 random enemies, and has a 15% chance to Horrify them for 2 rounds, causing them unable to use normal attack. Aspen's every normal attack grants him with 5% Attack, 5% Crit Damage and a Shield, which provides him with 10% Control Immune and 3% Damage Reduce.  (MAX 5 Shields can be stacked )."}
